import FullScreenContainer from './components/containerFullHeight';

export default () => (
    <FullScreenContainer className="border-4">
    <div className="p-4 shadow rounded bg-white w-full text-center">
      <h1 className="text-purple-500 leading-normal">Next.js</h1>
      <p className="text-gray-500">with Tailwind CSS</p>
    </div>
    </FullScreenContainer>
  )
